メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br><br>

<img src="http://image.rakuten.co.jp/gsx/cabinet/20141119_bnr_03.gif" alt="楽天ポイント10倍ページへ" width="300" height="101">
<br><br>

<h5>ASTRON GPSソーラー　8X SERIES Dual-Time</h5>
<p>デュアルタイム表示機能を搭載した8X53シリーズに、人気のカラーを追加！<br>
チタンモデルには、ゴールドやピンクゴールドカラーを採用し、リッチな表情を演出。<br>
ステンレススチールモデルには、ベーシックなカラーを採用することで、落ち着いた印象に。<br>
ラインナップが豊富になり、選ぶ楽しさが広がりました。</p>
<br>
<table style="text-align:center;">
<tr>
<td><img src="http://image.rakuten.co.jp/gsx/cabinet/seiko/astron-038_s.jpg" width="150" height="150" alt="SBXB073"><br>SBXB073</td>

<td><img src="http://image.rakuten.co.jp/gsx/cabinet/seiko/astron-039_s.jpg" width="150" height="150" alt="SBXB075"><br>SBXB075</td>

