<tr><th>メーカー名<BR>（正規輸入代理店）</th>
<td>セイコーウオッチ株式会社</td>
</tr>
<tr>
<th>ブランド名</th>
<td>ASTRON(アストロン)</td>
</tr>
<tr>
<th>ムーブメント</th>
<td>ソーラーGPS衛星電波修正 キャリバー：8X53<br>(フル充電時約6ヶ月間　パワーセーブ時約2年)</td>
</tr>
<tr>
<th>素材</th>
<td>
ケース：ステンレスケース(硬質コーティング)<br>
ベゼル：セラミックス<br>
裏ぶた：ステンレス<br>
風防：サファイアガラス（スーパークリア コーティング）<br>

（※）スーパークリア コーティング： 光の反射を99％以上抑制する透明被膜を、<br>
ガラスの表裏両面に施したセイコー独自の無反射コーティング処理です。<br>
太陽光や照明がまぶしい環境下でも、ガラスの存在を意識させません。<br>
また、表面の防汚膜により汚れがついても簡単に拭き取ることができます。
</td>
</tr>
<tr>
<th>サイズ</th>
<td>
ケース径：54.3×45.0mm<br>
厚さ    ：13.3mm
</td>
</tr>
<tr>
<th>重量</th>
<td>-g</td>
</tr>
<tr>
<th>防水性</th>
<td>10気圧防水</td>
</tr>
<tr>
<th>その他特徴</th>
<td>
精度:非受信時平均月差±15秒<br>
ルミブライト：あり(針・インデックス)<br>
スクリューバック<br>
過充電防止機能<br>
パワーセーブ機能<br>
パーペチュアルカレンダー機能<br>
ワールドタイム機能(40タイムゾーン)<br>
デュアルタイム表示機能<br>
レトログラード式曜日機構<br>
パワーリザーブ表示機能<br>
GPS衛星電波受信による タイムゾーン修正機能・スマートセンサー(自動時刻修正機能)・強制時刻修正機能<br>
捕捉衛星数表示機能<br>
受信結果表示機能<br>
受信オフ機能(機内モード)<br>
針位置自動修正機能<br>
</td>
</tr>
<tr>
<th>サイズ調整について</th>
<td>お客様のご希望により、ブレスレットのサイズを調整した上で、<br>
時計をお届けいたします。(サイズ調整無料)<br>
時計を装着する手首回りの長さをメジャーなどで計測いただき、<br>
その長さをご注文の際にお知らせ下さい。<br>
（コマを外した場合は、外したコマも時計と一緒にお送り致します。）<br>
<font color="#cc0000;">※サイズの調整をいたしますと返品、交換はお受けいたしかねますのでご了承下さい。</font>
</td>
</tr>
<tr>
<th>保証期間</th>
<td>メーカー保証　1年<br>
お買い上げの時計が、取り扱い説明書に沿った正常な使用状態で故障した場合、取り扱い説明書の記載内容の範囲で、保証期間に限り、無償修理致します。<br><br>
<b>■保証対象について</b><br>
 時計本体（ムーブメント・ケース）および金属バンドです。それ以外は保証の対象外です。<br>
修理のとき、ムーブメントを交換させていただいたり、ケース・文字板、針、ガラス・バンドなどに、一部代替部品を使用させていただくこともありますので、ご了承ください。
</td>
</tr>
