<h5>NEW ARRIVAL　新作</h5>


<h5>HIGH REVIEW　高評価商品</h5>



<br>

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br><br>
<h5>MARINEシリーズの中核となるエキスパートモデル</h5>
<p>1985年、世界初となる電子センサーによる水深計付きダイバーズウオッチ“アクアランド”を発売<br>（1989年より“プロマスター アクアランド”に名称変更）して以来、シチズンは<br>30年以上に渡りセンサー技術を搭載したプロフェッショナルダイバーズウオッチを<br>創出し続けてきました。『シチズン プロマスター』の名前は、世界的にも高い知名度を誇っています。<br>
アクアランドシリーズは常に進化を続けながら新たな歴史にその名を刻み続けていきます。</p>
<br>
<br>
<h5>操作性を追求したベゼル形状</h5>
<p>グローブを装着していても回しやすいように上部に大きな凹凸のあるベゼル形状を新たに開発しました。<br>一方で、ベゼルサイドには凹凸は付けず、ケースサイドと一体になるデザインを採用。<br>これにより、ぶつけるなどの衝撃を受けても誤作動しないよう安全性にも配慮しました。<br>
また、ケースサイドには操作性に優れた大きめのりゅうずやプッシュボタンを<br>装着していても邪魔になりにくい位置に配置しました。<br>これらにも誤作動防止のため、ねじロックタイプが採用されています。</p><br>
<br>
<h5>堅牢な二重構造ケース</h5>
<p>時計本体を守る外装は、貝のように時計内部を守る頑丈な構造にしました。<br>ケースサイドを取り巻くスタイリッシュなその2重のラインは、<br>デザイン面からも特徴的な形状になっています。
時計の心臓部であるムーブメントは、<br>まずムーブメント専用ケースによって守られます。<br>さらに、ステンレススチールを削り出した堅牢なケースと、同じく<br>ステンレススチールを削り出したパーツによってガッチリと二重にガードされます。<br>これにより高い耐衝撃性能を確保し、ダイビング中に岩にぶつけるなどの<br>アクシデントが起こった際にもムーブメントへの影響を軽減させます。<br>海の中で起こり得る“万が一”に備える構造となっています。<br>
また、定期的な電池交換のいらないエコ・ドライブ搭載なので、裏蓋の開閉の必要もなく、<br>高い防水性能を長期間維持できます。</p><br>
